import './App.css';


function App({id='not',children='없음'}) {

  const [count,setCount]=useState(0);

  const counter = () => {
    setCount(count+1);
    console.log(count);
  }

  const alt=() => {
    alert('알림');
  };

  setTimeout(
    alt
  ,1000);


  return (
   <>
  <button onClick={counter} id={id}>{children}</button>
  <p>{count}</p>
   </>
  );
}

export default App; //App이란 이름으로 다른 js파일에서 사용된다.
